Here is a little video from memory lane last summer with my boyfriend. He treated me to a beautiful day at the beach and some rollerskating on the boardwalk for my first time. Let's just say that i was much better for the after party than the actual day at the beach. It was the second time that he filmed me and that started to grow on me so I look forward to have some of your comments and see what you would like me to do for the next video. Have fun guys and see you soon
